pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract Phoenix is Ownable{

    event Payment(address indexed sender, address indexed receiver, uint256 amount, uint256 indexed storeId, string productId);
    event AddStore(address indexed wallet, uint256 indexed storeId, string storeName, string storeDescription);

    constructor(){}

    struct StoreInfo{
        string storeName;
        string storeDescription;
    }

    mapping(uint256=>address) public storesId;
    mapping(uint256=>StoreInfo) public storesInfo;

    function addStore
    (
        address wallet, 
        uint256 storeId, 
        string memory storeName, 
        string memory storeDescription
    ) external onlyOwner
    {
        require(wallet != address(0), "Pheonix: wallet is null address");
        require(storesId[storeId] == address(0), "Phoenix: store id is already in use");

        StoreInfo memory infos = StoreInfo(storeName, storeDescription);
        storesId[storeId] = wallet;
        storesInfo[storeId] = infos;
        emit AddStore(wallet, storeId, storeName, storeDescription);
    }

    function pay(address asset, uint256 amount, uint256 storeId, string memory productId) external {
        address receiver = storesId[storeId];
        require(receiver != address(0), "Phoenix: the store id is not found");
        IERC20 token = IERC20(asset);
        require(token.transferFrom(msg.sender, receiver, amount), "Phoenix: Transfer Failed");
        emit Payment(msg.sender, receiver, amount, storeId, productId);
    }
}
